import React from "react";

import Montain from "../../assets/Mountain.jpg";
import "./styles.css";
export default class Banner extends React.Component {
  render() {
    return (
      <div>
        <img className="banner-image" src={Montain} />
        <div className="count-down-area">
          <span className="count-down-area-text-">ContDown</span>
        </div>
      </div>
    );
  }
}
